import { TextField } from "@material-ui/core";
import "./Checkout.css";

const Checkout = (props) => {
  console.log(props);
  return (
    <div className="Checkout">
      <h2 id="chk-heading">Place Order</h2>
      <h3 id="chk-content">Order: {props.location.data.orderString}</h3>
      <h3 id="chk-content">Total Price: ${props.location.data.price}</h3>
      <TextField id="name-field" style={{ marginTop: 10 }} label="Name" />
    </div>
  );
};

export default Checkout;
